const CheckSection = () => {
    return (
        <div className="checkSectionContainer">
            <div className="checkSection-TitleWrapper">
                <div className="checkSection-formTitle">
                    <h1 className="checkSection-title">Estas listo para Chequear tu producto? </h1>
